import React from 'react'
import {
    Icon, MenuItem, Search, Header,
    Image,
    Menu,
    Segment,
    Sidebar, SidebarPusher,
    SidebarPushable,
} from 'semantic-ui-react'


const Topbar = () => {
    return (
        <div className='navbars'>
            <div className='topbar'>
                <Menu stackable style={{ width: "100%" }}>
                    <MenuItem>
                        <img alt='logo' src='https://react.semantic-ui.com/logo.png' />
                    </MenuItem>

                    <MenuItem
                        name='features'
                    //   active={activeItem === 'features'}
                    // onClick={this.handleItemClick}
                    >
                        Features
                    </MenuItem>

                    <MenuItem
                        name='testimonials'
                    //   active={activeItem === 'testimonials'}
                    // onClick={this.handleItemClick}
                    >
                        Testimonials
                    </MenuItem>

                    <MenuItem
                        name='sign-in'
                    //   active={activeItem === 'sign-in'}
                    // onClick={this.handleItemClick}
                    >
                        Sign-in
                    </MenuItem>
                </Menu>
            </div>
            
            <div className='sidebar'>
                    <Sidebar
                        as={Menu}
                        // animation='overlay'
                        icon='labeled'
                        vertical
                        visible
                        width='thin'
                        style = {{position:"relative"}}
                    >
                        <MenuItem as='a'>
                            <Icon name='home' />
                            Home
                        </MenuItem>
                        <MenuItem as='a'>
                            <Icon name='gamepad' />
                            Games
                        </MenuItem>
                        <MenuItem as='a'>
                            <Icon name='camera' />
                            Channels
                        </MenuItem>
                    </Sidebar>
            </div>
        </div>
    )
}

export default Topbar
